                                        <div>
                                            <p>Browser is a web testing library for Autosphere, based on the popular SeleniumLibrary.</p>
                                            <p>It uses the Selenium WebDriver modules internally to control a web browser. See <a href="http://seleniumhq.org">http://seleniumhq.org</a> for more information about Selenium in general.</p>
                                            <h3 id="Locating-elements">Locating elements</h3>
                                            <p>
                                                All keywords in the browser library that need to interact with an element on a web page take an argument typically named <code>locator</code> that specifies how to find the element. Most often the locator is given as a string using
                                                the locator syntax described below, but <a href="#Using-WebElements" class="name">using WebElements</a> is possible too.
                                            </p>
                                            <h4 id="Locator-syntax">Locator syntax</h4>
                                            <p>Finding elements can be done using different strategies such as the element id, XPath expressions, or CSS selectors. The strategy can either be explicitly specified with a prefix or the strategy can be implicit.</p>
                                            <h4 id="Default-locator-strategy">Default locator strategy</h4>
                                            <p>
                                                By default, locators are considered to use the keyword specific default locator strategy. All keywords support finding elements based on <code>id</code> and <code>name</code> attributes, but some keywords support additional
                                                attributes or other values that make sense in their context. For example, <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-link" class="name">Click Link</a> supports the <code>href</code> attribute and the
                                                link text and addition to the normal <code>id</code> and <code>name</code>.
                                            </p>
                                            <p>Examples:</p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>example</td>
                                                        <td># Match based on <code>id</code> or <code>name</code>.</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-link" class="name">Click Link</a></td>
                                                        <td>example</td>
                                                        <td># Match also based on link text and <code>href</code>.</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-button" class="name">Click Button</a></td>
                                                        <td>example</td>
                                                        <td># Match based on <code>id</code>, <code>name</code> or <code>value</code>.</td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                            <p>
                                                If a locator accidentally starts with a prefix recognized as <a href="#Explicit-locator-strategy" class="name">explicit locator strategy</a> or <a href="#Implicit-XPath-strategy" class="name">implicit XPath strategy</a>, it
                                                is possible to use the explicit <code>default</code> prefix to enable the default strategy.
                                            </p>
                                            <p>Examples:</p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>name:foo</td>
                                                        <td># Find element with name <code>foo</code>.</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>default:name:foo</td>
                                                        <td># Use default strategy with value <code>name:foo</code>.</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>//foo</td>
                                                        <td># Find element using XPath <code>//foo</code>.</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>default: //foo</td>
                                                        <td># Use default strategy with value <code>//foo</code>.</td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                            <h4 id="Explicit-locator-strategy">Explicit locator strategy</h4>
                                            <p>
                                                The explicit locator strategy is specified with a prefix using either syntax <code>strategy:value</code> or <code>strategy=value</code>.
                                            </p>
                                            <p>Locator strategies that are supported by default are listed in the table below. In addition to them, it is possible to register <a href="#Custom-locators" class="name">custom locators</a>.</p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <th>Strategy</th>
                                                        <th>Match based on</th>
                                                        <th>Example</th>
                                                    </tr>
                                                    <tr>
                                                        <td>id</td>
                                                        <td>Element <code>id</code>.</td>
                                                        <td><code>id:example</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>name</td>
                                                        <td><code>name</code> attribute.</td>
                                                        <td><code>name:example</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>identifier</td>
                                                        <td>Either <code>id</code> or <code>name</code>.</td>
                                                        <td><code>identifier:example</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>class</td>
                                                        <td>Element <code>class</code>.</td>
                                                        <td><code>class:example</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>tag</td>
                                                        <td>Tag name.</td>
                                                        <td><code>tag:div</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>xpath</td>
                                                        <td>XPath expression.</td>
                                                        <td><code>xpath://div[@id="example"]</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>css</td>
                                                        <td>CSS selector.</td>
                                                        <td><code>css:div#example</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>dom</td>
                                                        <td>DOM expression.</td>
                                                        <td><code>dom:document.images[5]</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>link</td>
                                                        <td>Exact text a link has.</td>
                                                        <td><code>link:The example</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>partial link</td>
                                                        <td>Partial link text.</td>
                                                        <td><code>partial link:he ex</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>sizzle</td>
                                                        <td>Sizzle selector deprecated.</td>
                                                        <td><code>sizzle:div.example</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>jquery</td>
                                                        <td>jQuery expression.</td>
                                                        <td><code>jquery:div.example</code></td>
                                                    </tr>
                                                    <tr>
                                                        <td>default</td>
                                                        <td>Keyword specific default behavior.</td>
                                                        <td><code>default:example</code></td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                            <p>
                                                See the <a href="#Default-locator-strategy" class="name">Default locator strategy</a> section below for more information about how the default strategy works. Using the explicit <code>default</code> prefix is only necessary if
                                                the locator value itself accidentally matches some of the explicit strategies.
                                            </p>
                                            <p>
                                                Different locator strategies have different pros and cons. Using ids, either explicitly like <code>id:foo</code> or by using the <a href="#Default-locator-strategy" class="name">default locator strategy</a> simply like
                                                <code>foo</code>, is recommended when possible, because the syntax is simple and locating elements by id is fast for browsers. If an element does not have an id or the id is not stable, other solutions need to be used. If an element
                                                has a unique tag name or class, using <code>tag</code>, <code>class</code> or <code>css</code> strategy like <code>tag:h1</code>, <code>class:example</code> or <code>css:h1.example</code> is often an easy solution. In more complex
                                                cases using XPath expressions is typically the best approach. They are very powerful but a downside is that they can also get complex.
                                            </p>
                                            <p>Examples:</p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>id:foo</td>
                                                        <td># Element with id 'foo'.</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>css:div#foo h1</td>
                                                        <td># h1 element under div with id 'foo'.</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>xpath: //div[@id="foo"]//h1</td>
                                                        <td># Same as the above using XPath, not CSS.</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>xpath: //*[contains(text(), "example")]</td>
                                                        <td># Element containing text 'example'.</td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                            <p><b>NOTE:</b></p>
                                            <ul>
                                                <li>Using the <code>sizzle</code> strategy or its alias <code>jquery</code> requires that the system under test contains the jQuery library.</li>
                                            </ul>
                                            <h4 id="Implicit XPath strategy">Implicit XPath strategy</h4>
                                            <p>If the locator starts with <code>//</code> or <code>(//</code>, the locator is considered to be an XPath expression. In other words, using <code>//div</code> is equivalent to using explicit <code>xpath://div</code>.</p>
                                            <p>Examples:</p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>//div[@id="foo"]//h1</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>(//div)[2]</td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                            <h4 id="Chaining-locators">Chaining locators</h4>
                                            <p>
                                                It's possible to chain multiple locators together as a single locator. Each chained locator must start with a locator strategy. Chained locators must be separated with a single space, two greater than characters, and followed with a
                                                space. It's also possible to mix different locator strategies, such as css or xpath. Also, a list can also be used to specify multiple locators, for instance when the chaining separator would conflict with the actual locator, or
                                                when an existing web element is used as a base.
                                            </p>
                                            <p>
                                                Although all locators support chaining, some locator strategies don't chain properly with previous values. This is because some locator strategies use JavaScript to find elements and JavaScript is executed for the whole browser
                                                context and not for the element found by the previous locator. Locator strategies that support chaining are the ones that are based on the Selenium API, such as <span class="name">xpath</span> or <span class="name">css</span>, but
                                                for example chaining is not supported by <span class="name">sizzle</span> or <span class="name">jquery</span>.
                                            </p>
                                            <p>Examples:</p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>css:.bar &gt;&gt; <a href="xpath://a">xpath://a</a></td>
                                                        <td># To find a link which is present inside an element with class "bar"</td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                            <p>List examples:</p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <td>${locator_list} =</td>
                                                        <td><span class="name">Create List</span></td>
                                                        <td>css:div#div_id</td>
                                                        <td><a href="xpath://*[text(">xpath://*[text(</a>), " &gt;&gt; "]</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#page-should-contain-element" class="name">Page Should Contain Element</a></td>
                                                        <td>${locator_list}</td>
                                                        <td></td>
                                                        <td></td>
                                                    </tr>
                                                    <tr>
                                                        <td>${element} =</td>
                                                        <td>Get WebElement</td>
                                                        <td><a href="xpath://*[text(">xpath://*[text(</a>), " &gt;&gt; "]</td>
                                                        <td></td>
                                                    </tr>
                                                    <tr>
                                                        <td>${locator_list} =</td>
                                                        <td><span class="name">Create List</span></td>
                                                        <td>css:div#div_id</td>
                                                        <td>${element}</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#page-should-contain-element" class="name">Page Should Contain Element</a></td>
                                                        <td>${locator_list}</td>
                                                        <td></td>
                                                        <td></td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                            <h4 id="Using-WebElements">Using WebElements</h4>
                                            <p>
                                                In addition to specifying a locator as a string, it is possible to use Selenium's WebElement objects. This requires first getting a WebElement, for example, by using the
                                                <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#get-webelement" class="name">Get WebElement</a> keyword.
                                            </p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <td>${elem} =</td>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#get-webelement" class="name">Get WebElement</a></td>
                                                        <td>id:example</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>${elem}</td>
                                                        <td></td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                            <h4 id="Custom-locators">Custom locators</h4>
                                            <p>
                                                If more complex lookups are required than what is provided through the default locators, custom lookup strategies can be created. Using custom locators is a two part process. First, create a keyword that returns a WebElement that
                                                should be acted on:
                                            </p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <td>Custom Locator Strategy</td>
                                                        <td>[Arguments]</td>
                                                        <td>${browser}</td>
                                                        <td>${locator}</td>
                                                        <td>${tag}</td>
                                                        <td>${constraints}</td>
                                                    </tr>
                                                    <tr>
                                                        <td></td>
                                                        <td>${element}=</td>
                                                        <td>Execute Javascript</td>
                                                        <td>return window.document.getElementById('${locator}');</td>
                                                        <td></td>
                                                        <td></td>
                                                    </tr>
                                                    <tr>
                                                        <td></td>
                                                        <td>[Return]</td>
                                                        <td>${element}</td>
                                                        <td></td>
                                                        <td></td>
                                                        <td></td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                            <p>
                                                This keyword is a reimplementation of the basic functionality of the <code>id</code> locator where <code>${browser}</code> is a reference to a WebDriver instance and <code>${locator}</code> is the name of the locator strategy. To
                                                use this locator, it must first be registered by using the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#add-location-strategy" class="name">Add Location Strategy</a> keyword:
                                            </p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#add-location-strategy" class="name">Add Location Strategy</a></td>
                                                        <td>custom</td>
                                                        <td>Custom Locator Strategy</td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                            <p>
                                                The first argument of <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#add-location-strategy" class="name">Add Location Strategy</a> specifies the name of the strategy and it must be unique. After registering the
                                                strategy, the usage is the same as with other locators:
                                            </p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#click-element" class="name">Click Element</a></td>
                                                        <td>custom:example</td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                            <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#add-location-strategy" class="name">Add Location Strategy</a> keyword for more details.</p>
                                            <h3 id="Browser-and-Window">Browser and Window</h3>
                                            <p>There is different conceptual meaning when this library talks about windows or browsers. This chapter explains those differences.</p>
                                            <h4 id="Browser">Browser</h4>
                                            <p>
                                                When <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#open-browser" class="name">Open Browser</a> or
                                                <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#create-webdriver" class="name">Create WebDriver</a> keyword is called, it will create a new Selenium WebDriver instance by using the
                                                <a href="https://www.seleniumhq.org/docs/03_webdriver.jsp">Selenium WebDriver</a> API. In this library's terms, a new browser is created. It is possible to start multiple independent browsers (Selenium Webdriver instances) at the
                                                same time, by calling <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#open-browser" class="name">Open Browser</a> or
                                                <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#create-webdriver" class="name">Create WebDriver</a> multiple times. These browsers are usually independent of each other and do not share data like cookies,
                                                sessions or profiles. Typically when the browser starts, it creates a single window which is shown to the user.
                                            </p>
                                            <h4 id="Window">Window</h4>
                                            <p>
                                                Windows are the part of a browser that loads the web site and presents it to the user. All content of the site is the content of the window. Windows are children of a browser. In this context a browser is a synonym for WebDriver
                                                instance. One browser may have multiple windows. Windows can appear as tabs, as separate windows or pop-ups with different position and size. Windows belonging to the same browser typically share the sessions detail, like cookies.
                                                If there is a need to separate sessions detail, example login with two different users, two browsers (Selenium WebDriver instances) must be created. New windows can be opened example by the application under test or by example
                                                <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#execute-javascript" class="name">Execute Javascript</a> keyword:
                                            </p>
                                            <pre><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#execute-javascript" class="name">Execute Javascript</a>    window.open()    # Opens a new window with location about:blank
    </pre>
                                            <p>The example below opens multiple browsers and windows, to demonstrate how the different keywords can be used to interact with browsers, and windows attached to these browsers.</p>
                                            <p>Structure:</p>
                                            <pre>
BrowserA
               Window 1  (location=https://Autosphere.org/)
               Window 2  (location=https://robocon.io/)
               Window 3  (location=https://github.com/Autosphere/)
    
    BrowserB
               Window 1  (location=https://github.com/)
    </pre>
                                            <p>Example:</p>
                                            <table border="1">
                                                <tbody>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#open-browser" class="name">Open Browser</a></td>
                                                        <td>${BROWSER}</td>
                                                        <td>alias=BrowserA</td>
                                                        <td># BrowserA with first window is opened.</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#execute-javascript" class="name">Execute Javascript</a></td>
                                                        <td>window.open()</td>
                                                        <td></td>
                                                        <td></td>
                                                        <td># In BrowserA second window is opened.</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#switch-window" class="name">Switch Window</a></td>
                                                        <td>locator=NEW</td>
                                                        <td></td>
                                                        <td></td>
                                                        <td># Switched to second window in BrowserA</td>
                                                    </tr>
                                                    <tr>
                                                        <td><a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#go-to" class="name">Go To</a></td>
                                                        <td><a href="https://robocon.io">https://robocon.io</a></td>
                                                        <td></td>
                                                        <td></td>
                                                        <td># Second window navigates to robocon site.</td>
                                                    </tr>
                                                    <tr>
