                                            <h3 id="Timeouts,-waits,-and-delays">Timeouts, waits, and delays</h3>
                                            <p>
                                                This section discusses different ways how to wait for elements to appear on web pages and to slow down execution speed otherwise. It also explains the <a href="#Time-format" class="name">time format</a> that can be used when
                                                setting various timeouts, waits, and delays.
                                            </p>
                                            <h4 id="Timeout">Timeout</h4>
                                            <p>
                                                This library contains various keywords that have an optional <code>timeout</code> argument that specifies how long these keywords should wait for certain events or actions. These keywords include, for example,
                                                <code>Wait ...</code> keywords and keywords related to alerts. Additionally <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#execute-async-javascript" class="name">Execute Async Javascript</a>. Although it does
                                                not have <code>timeout</code>, argument, uses a timeout to define how long asynchronous JavaScript can run.
                                            </p>
                                            <p>
                                                The default timeout these keywords use can be set globally either by using the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#set-selenium-timeout" class="name">Set Selenium Timeout</a> keyword or with the
                                                <code>timeout</code> argument when <a href="#Importing" class="name">importing</a> the library. See <a href="#Time-format" class="name">time format</a> below for supported timeout syntax.
                                            </p>
                                            <h4 id="Implicit-wait">Implicit wait</h4>
                                            <p>
                                                Implicit wait specifies the maximum time how long Selenium waits when searching for elements. It can be set by using the
                                                <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#set-selenium-implicit-wait" class="name">Set Selenium Implicit Wait</a> keyword or with the <code>implicit_wait</code> argument when
                                                <a href="#Importing" class="name">importing</a> the library. See <a href="https://www.seleniumhq.org/docs/04_webdriver_advanced.jsp">Selenium documentation</a> for more information about this functionality.
                                            </p>
                                            <p>See <a href="#Time-format" class="name">time format</a> below for supported syntax.</p>
                                            <h4 id="Selenium speed">Selenium speed</h4>
                                            <p>
                                                Selenium execution speed can be slowed down globally by using <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#set-selenium-speed" class="name">Set Selenium speed</a> keyword. This functionality is designed to be
                                                used for demonstrating or debugging purposes. Using it to make sure that elements appear on a page is not a good idea. The above-explained timeouts and waits should be used instead.
                                            </p>
                                            <p>See <a href="#Time-format" class="name">time format</a> below for supported syntax.</p>
                                            <h4 id="Time format">Time format</h4>
                                            <p>
                                                All timeouts and waits can be given as numbers considered seconds (e.g. <code>0.5</code> or <code>42</code>) or in Autosphere's time syntax (e.g. <code>1.5 seconds</code> or <code>1 min 30 s</code>).
                                            </p>
                                            <h3 id="Run-on-failure-functionality">Run-on-failure functionality</h3>
                                            <p>
                                                This library has a handy feature that it can automatically execute a keyword if any of its own keywords fails. By default, it uses the
                                                <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#capture-page-screenshot" class="name">Capture Page Screenshot</a> keyword, but this can be changed either by using the
                                                <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#register-keyword-to-run-on-failure" class="name">Register Keyword To Run On Failure</a> keyword or with the <code>run_on_failure</code> argument when
                                                <a href="#Importing" class="name">importing</a> the library. It is possible to use any keyword from any imported library or resource file.
                                            </p>
                                            <p>The run-on-failure functionality can be disabled by using a special value <code>NOTHING</code> or anything considered false (see <span class="name">Boolean arguments</span>) such as <code>NONE</code>.</p>
                                        </div>

                                    </div>
                                </div>
                            </div>
