                                                        <div class="keyword" id="add-cookie">
                                                            <h3><a href="#add-cookie">Add Cookie</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Adds a cookie to your current session.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>name</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>value</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>path</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>domain</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>secure</td>
                                                                            <td>bool</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>expiry</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p><code>name</code> and <code>value</code> are required, <code>path</code>, <code>domain</code>,
                                                                    <code>secure</code> and <code>expiry</code> are optional. Expiry supports the same formats as the DateTime library or an epoch timestamp.
                                                                </p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#add-cookie" class="name">Add Cookie</a></td>
                                                                            <td>foo</td>
                                                                            <td>bar</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#add-cookie" class="name">Add Cookie</a></td>
                                                                            <td>foo</td>
                                                                            <td>bar</td>
                                                                            <td>domain=example.com</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#add-cookie" class="name">Add Cookie</a></td>
                                                                            <td>foo</td>
                                                                            <td>bar</td>
                                                                            <td>expiry=2027-09-28 16:21:35</td>
                                                                            <td># Expiry as timestamp.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#add-cookie" class="name">Add Cookie</a></td>
                                                                            <td>foo</td>
                                                                            <td>bar</td>
                                                                            <td>expiry=1822137695</td>
                                                                            <td># Expiry as epoch seconds.</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Prior to SeleniumLibrary 3.0 setting expiry did not work.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="add-location-strategy">
                                                            <h3><a href="#add-location-strategy">Add Location Strategy</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Adds a custom location strategy.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>strategy_name</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>strategy_keyword</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>persist</td>
                                                                            <td>bool</td>
                                                                            <td>False</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>See <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Custom-locators" class="name">Custom
                                                                        locators</a> for information on how to create and use custom strategies. <a href="#remove-location-strategy" class="name">Remove Location Strategy</a> can be used to remove a registered strategy.</p>
                                                                <p>Location strategies are automatically removed after leaving the current scope by default. Setting
                                                                    <code>persist</code> to a true value (see Boolean arguments) will cause the location strategy to stay registered throughout the life of the test.
                                                                </p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="alert-should-be-present">
                                                            <h3><a href="#alert-should-be-present">Alert Should Be Present</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Verifies that an alert is present and by default, accepts it.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>text</td>
                                                                            <td>str</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>action</td>
                                                                            <td>str</td>
                                                                            <td>ACCEPT</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>timeout</td>
                                                                            <td>timedelta</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>Fails if no alert is present. If <code>text</code> is a non-empty string, then it is used to verify alert's message. The alert is accepted by default, but that behavior can be controlled by using the
                                                                    <code>action</code> argument same way as with <a href="#handle-alert" class="name">Handle Alert</a>.
                                                                </p>
                                                                <p><code>timeout</code> specifies how long to wait for the alert to appear. If it is not given, the global default <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Timeout" class="name">timeout</a> is used instead.</p>
                                                                <p><code>action</code> and <code>timeout</code> arguments are new in SeleniumLibrary 3.0. In earlier versions, the alert was always accepted and a timeout was hardcoded to one second.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="alert-should-not-be-present">
                                                            <h3><a href="#alert-should-not-be-present">Alert Should Not Be Present</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Verifies that no alert is present.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>action</td>
                                                                            <td>str</td>
                                                                            <td>ACCEPT</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>timeout</td>
                                                                            <td>timedelta</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>If the alert actually exists, the <code>action</code> argument determines how it should be handled. By default, the alert is accepted, but it can be also dismissed or left open the same way as with the <a href="#handle-alert" class="name">Handle Alert</a> keyword.</p>
                                                                <p><code>timeout</code> specifies how long to wait for the alert to appear. By default, is not waited for the alert at all, but a custom time can be given if alert may be delayed. See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Time-format" class="name">time format</a> section for information about the syntax.</p>
                                                                <p>New in SeleniumLibrary 3.0.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="assign-id-to-element">
                                                            <h3><a href="#assign-id-to-element">Assign Id To Element</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Assigns a temporary ``id`` to the element specified by ``locator``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>id</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Assigns a temporary <code>id</code> to the element specified by <code>locator</code>.</p>
                                                                <p>This is mainly useful if the locator is complicated and/or slow XPath expression and it is needed multiple times. Identifier expires when the page is reloaded.</p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating elements</a> section for details about the locator syntax.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#assign-id-to-element" class="name">Assign ID to Element</a></td>
                                                                            <td>//ul[@class='example' and ./li[contains(., 'Stuff')]]</td>
                                                                            <td>my id</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#page-should-contain-element" class="name">Page Should Contain Element</a></td>
                                                                            <td>my id</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="attach-chrome-browser">
                                                            <h3><a href="#attach-chrome-browser">Attach Chrome Browser</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Attach to an existing instance of Chrome or Chromium.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>port</td>
                                                                            <td>int</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>alias</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>Requires that the browser was started with the command line option
                                                                    <code>--remote-debugging-port=&lt;port&gt;</code>, where port is any 4-digit number not being used by other applications.
                                                                </p>
                                                                <p>That port can then be used to connect using this keyword.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>Attach Chrome Browser</td>
                                                                            <td>port=9222</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="capture-element-screenshot">
                                                            <h3><a href="#capture-element-screenshot">Capture Element Screenshot</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Captures a screenshot from the element identified by ``locator`` and embeds it into log file.
                                                                </p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, None, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>filename</td>
                                                                            <td>str</td>
                                                                            <td>selenium-element-screenshot-{index}.png</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Captures a screenshot from the element identified by <code>locator</code> and embeds it into log file.
                                                                </p>
                                                                <p>See <a href="#capture-page-screenshot" class="name">Capture Page Screenshot</a> for details about
                                                                    <code>filename</code> argument. See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating
                                                                        elements</a> section for details about the locator syntax.
                                                                </p>
                                                                <p>An absolute path to the created element screenshot is returned.</p>
                                                                <p>Support for capturing the screenshot from an element has limited support among browser vendors. Please check the browser vendor driver documentation does the browser support capturing a screenshot from an element.
                                                                </p>
                                                                <p>New in SeleniumLibrary 3.3. Support for EMBED is new in SeleniumLibrary 4.2.</p>
                                                                <p>Examples:</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#capture-element-screenshot" class="name">Capture Element Screenshot</a></td>
                                                                            <td>id:image_id</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#capture-element-screenshot" class="name">Capture Element Screenshot</a></td>
                                                                            <td>id:image_id</td>
                                                                            <td>${OUTPUTDIR}/id_image_id-1.png</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#capture-element-screenshot" class="name">Capture Element Screenshot</a></td>
                                                                            <td>id:image_id</td>
                                                                            <td>EMBED</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="capture-page-screenshot">
                                                            <h3><a href="#capture-page-screenshot">Capture Page Screenshot</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Takes a screenshot of the current page and embeds it into a log file.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>filename</td>
                                                                            <td>str</td>
                                                                            <td>selenium-screenshot-{index}.png</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p><code>filename</code> argument specifies the name of the file to write the screenshot into. The directory where screenshots are saved can be set when <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Importing" class="name">importing</a> the library or by using the <a href="#set-screenshot-directory" class="name">Set Screenshot Directory</a> keyword. If the directory is not configured, screenshots are saved to the same directory where Autosphere's
                                                                    log file is written.</p>
                                                                <p>If <code>filename</code> equals to EMBED (case insensitive), then screenshot is embedded as Base64 image to the log.html. In this case file is not created in the filesystem.</p>
                                                                <p>Starting from SeleniumLibrary 1.8, if <code>filename</code> contains marker <code>{index}</code>, it will be automatically replaced with an unique running index, preventing files to be overwritten. Indices start from 1, and how they are represented
                                                                    can be customized using Python's <a href="https://docs.python.org/3/library/string.html#format-string-syntax">format string syntax</a>.
                                                                </p>
                                                                <p>An absolute path to the created screenshot file is returned or if <code>filename</code> equals to EMBED, word EMBED is returned.</p>
                                                                <p>Support for EMBED is new in SeleniumLibrary 4.2</p>
                                                                <p>Examples:</p>
