                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>file_path</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Inputs the <code>file_path</code> into the file input field <code>locator</code>.</p>
                                                                <p>This keyword is most often used to input files into upload forms. The keyword does not check
                                                                    <code>file_path</code> is the file or folder available on the machine where tests are executed. If the
                                                                    <code>file_path</code> points at a file and when using Selenium Grid, Selenium will <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver_remote/selenium.webdriver.remote.command.html?highlight=upload#selenium.webdriver.remote.command.Command.UPLOAD_FILE">magically</a>,
                                                                    transfer the file from the machine where the tests are executed to the Selenium Grid node where the browser is running. Then Selenium will send the file path, from the nodes file system, to the browser.
                                                                </p>
                                                                <p>That <code>file_path</code> is not checked, is new in SeleniumLibrary 4.0.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
