                                                        <div class="keyword" id="click-element">
                                                            <h3><a href="#click-element">Click Element</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Click the element identified by ``locator``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>modifier</td>
                                                                            <td>bool, str</td>
                                                                            <td>False</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>action_chain</td>
                                                                            <td>bool</td>
                                                                            <td>False</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Click the element identified by <code>locator</code>.</p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating elements</a> section for details about the locator syntax.</p>
                                                                <p>The <code>modifier</code> argument can be used to pass <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver/selenium.webdriver.common.keys.html#selenium.webdriver.common.keys.Keys">Selenium
                                                                        Keys</a> when clicking the element. The + can be used as a separator for different Selenium Keys. The CTRL is internally translated to the CONTROL key. The <code>modifier</code> is space and case insensitive, example "alt" and " aLt
                                                                    " are supported formats to <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver/selenium.webdriver.common.keys.html#selenium.webdriver.common.keys.Keys.ALT">ALT
                                                                        key</a> . If <code>modifier</code> does not match to Selenium Keys, keyword fails.</p>
                                                                <p>If <code>action_chain</code> argument is true, see Boolean arguments for more details on how to set boolean argument, then keyword uses ActionChain based click instead of the &lt;web_element&gt;.click() function. If both <code>action_chain</code> and <code>modifier</code> are defined, the click will be performed using <code>modifier</code> and <code>action_chain</code> will be ignored.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>Click Element</td>
                                                                            <td>id:button</td>
                                                                            <td></td>
                                                                            <td># Would click element without any modifiers.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Click Element</td>
                                                                            <td>id:button</td>
                                                                            <td>CTRL</td>
                                                                            <td># Would click element with CTLR key pressed down.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Click Element</td>
                                                                            <td>id:button</td>
                                                                            <td>CTRL+ALT</td>
                                                                            <td># Would click element with CTLR and ALT keys pressed down.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Click Element</td>
                                                                            <td>id:button</td>
                                                                            <td>action_chain=True</td>
                                                                            <td># Clicks the button using an Selenium ActionChains</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>The <code>modifier</code> argument is new in SeleniumLibrary 3.2 The <code>action_chain</code> argument is new in SeleniumLibrary 4.1</p>
                                                            </div>
                                                        </div>

