                                                        <div class="keyword" id="create-webdriver">
                                                            <h3><a href="#create-webdriver">Create Webdriver</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Creates an instance of Selenium WebDriver.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>driver_name</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>alias</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>kwargs</td>
                                                                            <td></td>
                                                                            <td>{}</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>init_kwargs</td>
                                                                            <td></td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>Like <a href="#open-browser" class="name">Open Browser</a>, but allows passing arguments to the created WebDriver instance directly. This keyword should only be used if the functionality provided by <a href="#open-browser" class="name">Open Browser</a> is not adequate.</p>
                                                                <p><code>driver_name</code> must be a WebDriver implementation name like Firefox, Chrome, Ie, Opera, Safari, PhantomJS, or Remote.</p>
                                                                <p>The initialized WebDriver can be configured either with a Python dictionary <code>kwargs</code> or by using keyword arguments <code>**init_kwargs</code>. These arguments are passed directly to WebDriver without any processing. See <a href="https://seleniumhq.github.io/selenium/docs/api/py/api.html">Selenium API documentation</a> for details about the supported arguments.</p>
                                                                <p>Examples:</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td># Use proxy with Firefox</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${proxy}=</td>
                                                                            <td>Evaluate</td>
                                                                            <td>selenium.webdriver.Proxy()</td>
                                                                            <td>modules=selenium, selenium.webdriver</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${proxy.http_proxy}=</td>
                                                                            <td>Set Variable</td>
                                                                            <td>localhost:8888</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#create-webdriver" class="name">Create Webdriver</a></td>
                                                                            <td>Firefox</td>
                                                                            <td>proxy=${proxy}</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td># Use proxy with PhantomJS</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${service args}=</td>
                                                                            <td>Create List</td>
                                                                            <td>--proxy=192.168.132.104:8888</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#create-webdriver" class="name">Create Webdriver</a></td>
                                                                            <td>PhantomJS</td>
                                                                            <td>service_args=${service args}</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Returns the index of this browser instance which can be used later to switch back to it. Index starts from 1 and is reset back to it when <a href="#close-all-browsers" class="name">Close All Browsers</a> keyword is used. See <a href="#switch-browser" class="name">Switch Browser</a> for an example.</p>
                                                            </div>
                                                        </div>

