                                                        <div class="keyword" id="execute-async-javascript">
                                                            <h3><a href="#execute-async-javascript">Execute Async Javascript</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Executes asynchronous JavaScript code with possible arguments.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>code</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>Similar to <a href="#execute-javascript" class="name">Execute Javascript</a> except that scripts executed with this keyword must explicitly signal they are finished by invoking the provided callback. This callback is always injected into the
                                                                    executed function as the last argument.</p>
                                                                <p>Scripts must complete within the script timeout or this keyword will fail. See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Timeout" class="name">Timeout</a> section for more information.</p>
                                                                <p>Starting from SeleniumLibrary 3.2 it is possible to provide JavaScript <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver_remote/selenium.webdriver.remote.webdriver.html#selenium.webdriver.remote.webdriver.WebDriver.execute_async_script">arguments</a> as part of <code>code</code> argument. See <a href="#execute-javascript" class="name">Execute
                                                                        Javascript</a> for more details.</p>
                                                                <p>Examples:</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#execute-async-javascript" class="name">Execute Async JavaScript</a></td>
                                                                            <td>var callback = arguments[arguments.length - 1]; window.setTimeout(callback, 2000);</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#execute-async-javascript" class="name">Execute Async JavaScript</a></td>
                                                                            <td>${CURDIR}/async_js_to_execute.js</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${result} =</td>
                                                                            <td><a href="#execute-async-javascript" class="name">Execute Async JavaScript</a></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>...</td>
                                                                            <td>var callback = arguments[arguments.length - 1];</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>...</td>
                                                                            <td>function answer(){callback("text");};</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>...</td>
                                                                            <td>window.setTimeout(answer, 2000);</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Should Be Equal</td>
                                                                            <td>${result}</td>
                                                                            <td>text</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="execute-cdp">
                                                            <h3><a href="#execute-cdp">Execute Cdp</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Executes Chrome DevTools Protocol commands</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>command</td>
                                                                            <td></td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>parameters</td>
                                                                            <td></td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>Works only with Chrome/Chromium</p>
                                                                <p>For more information, available commands and parameters, see: <a href="https://chromedevtools.github.io/devtools-protocol/">https://chromedevtools.github.io/devtools-protocol/</a>
                                                                </p>
                                                                <p><code>command</code> command to execute as string</p>
                                                                <p><code>parameters</code> parameters for command as a dictionary</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>Open Chrome Browser</td>
                                                                            <td>about:blank</td>
                                                                            <td>headless=True</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>&amp;{params}</td>
                                                                            <td>Create Dictionary</td>
                                                                            <td>useragent=Chrome/83.0.4103.53</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Execute CDP</td>
                                                                            <td>Network.setUserAgentOverride</td>
                                                                            <td>${params}</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Go To</td>
                                                                            <td><a href="https://autosphere.ai">https://autosphere.ai</a></td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="execute-javascript">
                                                            <h3><a href="#execute-javascript">Execute Javascript</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Executes the given JavaScript code with possible arguments.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>code</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p><code>code</code> may be divided into multiple cells in the test data and <code>code</code> may contain multiple lines of code and arguments. In that case, the JavaScript code parts are concatenated together without adding spaces and optional
                                                                    arguments are separated from <code>code</code>.</p>
                                                                <p>If <code>code</code> is a path to an existing file, the JavaScript to execute will be read from that file. Forward slashes work as a path separator on all operating systems.</p>
                                                                <p>The JavaScript executes in the context of the currently selected frame or window as the body of an anonymous function. Use <code>window</code> to refer to the window of your application and
                                                                    <code>document</code> to refer to the document object of the current frame or window, e.g.
                                                                    <code>document.getElementById('example')</code>.
                                                                </p>
                                                                <p>This keyword returns whatever the executed JavaScript code returns. Return values are converted to the appropriate Python types.</p>
                                                                <p>Starting from SeleniumLibrary 3.2 it is possible to provide JavaScript <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver_remote/selenium.webdriver.remote.webdriver.html#selenium.webdriver.remote.webdriver.WebDriver.execute_script">arguments</a> as part of <code>code</code> argument. The JavaScript code and arguments must be separated with JAVASCRIPT and ARGUMENTS markers and must be used exactly with this format. If the Javascript code is first, then the JAVASCRIPT marker is
                                                                    optional. The order of JAVASCRIPT and ARGUMENTS markers can be swapped, but if ARGUMENTS is the first marker, then JAVASCRIPT marker is mandatory. It is only allowed to use JAVASCRIPT and ARGUMENTS markers only one time in the <code>code</code> argument.</p>
                                                                <p>Examples:</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#execute-javascript" class="name">Execute JavaScript</a></td>
                                                                            <td>window.myFunc('arg1', 'arg2')</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#execute-javascript" class="name">Execute JavaScript</a></td>
                                                                            <td>${CURDIR}/js_to_execute.js</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#execute-javascript" class="name">Execute JavaScript</a></td>
                                                                            <td>alert(arguments[0]);</td>
                                                                            <td>ARGUMENTS</td>
                                                                            <td>123</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#execute-javascript" class="name">Execute JavaScript</a></td>
                                                                            <td>ARGUMENTS</td>
                                                                            <td>123</td>
                                                                            <td>JAVASCRIPT</td>
                                                                            <td>alert(arguments[0]);</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="frame-should-contain">
                                                            <h3><a href="#frame-should-contain">Frame Should Contain</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Verifies that frame identified by ``locator`` contains ``text``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>text</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>loglevel</td>
                                                                            <td>str</td>
                                                                            <td>TRACE</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Verifies that frame identified by <code>locator</code> contains <code>text</code>.</p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating elements</a> section for details about the locator syntax.</p>
                                                                <p>See <a href="#page-should-contain" class="name">Page Should Contain</a> for an explanation about the
                                                                    <code>loglevel</code> argument.
                                                                </p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="get-all-links">
                                                            <h3><a href="#get-all-links">Get All Links</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Returns a list containing ids of all links found in current page.</p>


                                                                <p>If a link has no id, an empty string will be in the list instead.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="get-browser-aliases">
                                                            <h3><a href="#get-browser-aliases">Get Browser Aliases</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Returns aliases of all active browser that has an alias as NormalizedDict. The dictionary contains the aliases as keys and the index as value. This can be accessed as dictionary ``${aliases.key}`` or as list ``@{aliases}[0]``.</p>

                                                                <p>Returns aliases of all active browser that has an alias as NormalizedDict. The dictionary contains the aliases as keys and the index as value. This can be accessed as dictionary <code>${aliases.key}</code> or as list <code>@{aliases}[0]</code>.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="https://example.com">https://example.com</a></td>
                                                                            <td>alias=BrowserA</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="https://example.com">https://example.com</a></td>
                                                                            <td>alias=BrowserB</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>&amp;{aliases}</td>
                                                                            <td><a href="#get-browser-aliases" class="name">Get Browser Aliases</a></td>
                                                                            <td></td>
                                                                            <td># &amp;{aliases} = { BrowserA=1|BrowserB=2 }</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Log</td>
                                                                            <td>${aliases.BrowserA}</td>
                                                                            <td></td>
                                                                            <td># logs <code>1</code></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>FOR</td>
                                                                            <td>${alias}</td>
                                                                            <td>IN</td>
                                                                            <td>@{aliases}</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td></td>
                                                                            <td>Log</td>
                                                                            <td>${alias}</td>
                                                                            <td># logs <code>BrowserA</code> and <code>BrowserB</code></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>END</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>See <a href="#switch-browser" class="name">Switch Browser</a> for more information and examples.</p>
                                                                <p>New in SeleniumLibrary 4.0</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="get-browser-capabilities">
                                                            <h3><a href="#get-browser-capabilities">Get Browser Capabilities</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Get dictionary of browser properties</p>


                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>${caps}=</td>
                                                                            <td>Get Browser Capabilities</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="get-browser-ids">
                                                            <h3><a href="#get-browser-ids">Get Browser Ids</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Returns index of all active browser as list.</p>


                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>@{browser_ids}=</td>
                                                                            <td>Get Browser Ids</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>FOR</td>
                                                                            <td>${id}</td>
                                                                            <td>IN</td>
                                                                            <td>@{browser_ids}</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td></td>
                                                                            <td>@{window_titles}=</td>
                                                                            <td>Get Window Titles</td>
                                                                            <td>browser=${id}</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td></td>
                                                                            <td>Log</td>
                                                                            <td>Browser ${id} has these windows: ${window_titles}</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>END</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>See <a href="#switch-browser" class="name">Switch Browser</a> for more information and examples.</p>
                                                                <p>New in SeleniumLibrary 4.0</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="get-cookie">
                                                            <h3><a href="#get-cookie">Get Cookie</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Returns information of cookie with ``name`` as an object.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>name</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Returns information of cookie with <code>name</code> as an object.</p>
                                                                <p>If no cookie is found with <code>name</code>, keyword fails. The cookie object contains details about the cookie. Attributes available in the object are documented in the table below.</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Attribute</th>
                                                                            <th>Explanation</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>name</td>
                                                                            <td>The name of a cookie.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>value</td>
                                                                            <td>Value of the cookie.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>path</td>
                                                                            <td>Indicates a URL path, for example <code>/</code>.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>domain</td>
                                                                            <td>The domain, the cookie is visible to.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>secure</td>
                                                                            <td>When true, the cookie is only used with HTTPS connections.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>httpOnly</td>
                                                                            <td>When true, the cookie is not accessible via JavaScript.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>expiry</td>
                                                                            <td>Python datetime object indicating when the cookie expires.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>extra</td>
                                                                            <td>Possible attributes outside of the WebDriver specification</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>See the <a href="https://w3c.github.io/webdriver/#cookies">WebDriver specification</a> for details about the cookie information. Notice that <code>expiry</code> is specified as a <a href="https://docs.python.org/3/library/datetime.html#datetime.datetime">datetime object</a>,
                                                                    not as seconds since Unix Epoch like WebDriver natively does.</p>
                                                                <p>In some cases, example when running a browser in the cloud, it is possible that the cookie contains other attributes than is defined in the <a href="https://w3c.github.io/webdriver/#cookies">WebDriver
                                                                        specification</a>. These other attributes are available in an <code>extra</code> attribute in the cookie object and it contains a dictionary of the other attributes. The <code>extra</code> attribute is new in SeleniumLibrary 4.0.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#add-cookie" class="name">Add Cookie</a></td>
                                                                            <td>foo</td>
                                                                            <td>bar</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${cookie} =</td>
                                                                            <td><a href="#get-cookie" class="name">Get Cookie</a></td>
                                                                            <td>foo</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Should Be Equal</td>
                                                                            <td>${cookie.name}</td>
                                                                            <td>foo</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Should Be Equal</td>
                                                                            <td>${cookie.value}</td>
                                                                            <td>bar</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Should Be True</td>
                                                                            <td>${cookie.expiry.year} &gt; 2017</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>New in SeleniumLibrary 3.0.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="get-cookies">
                                                            <h3><a href="#get-cookies">Get Cookies</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Returns all cookies of the current page.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>as_dict</td>
                                                                            <td>bool</td>
                                                                            <td>False</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>If <code>as_dict</code> argument evaluates as false, see Boolean arguments for more details, then cookie information is returned as a single string in format
                                                                    <code>name1=value1; name2=value2; name3=value3</code>. When <code>as_dict</code> argument evaluates as true, cookie information is returned as Autosphere dictionary format. The string format can be used, for example, for logging purposes
                                                                    or in headers when sending HTTP requests. The dictionary format is helpful when the result can be passed to requests library's Create Session keyword's optional cookies parameter.
                                                                </p>
                                                                <p>The ` as_dict` argument is new in SeleniumLibrary 3.3</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="get-element-attribute">
                                                            <h3><a href="#get-element-attribute">Get Element Attribute</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Returns the value of ``attribute`` from the element ``locator``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>attribute</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Returns the value of <code>attribute</code> from the element <code>locator</code>.</p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating elements</a> section for details about the locator syntax.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>${id}=</td>
                                                                            <td><a href="#get-element-attribute" class="name">Get Element Attribute</a></td>
                                                                            <td>css:h1</td>
                                                                            <td>id</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Passing attribute name as part of the <code>locator</code> was removed in SeleniumLibrary 3.2. The explicit <code>attribute</code> argument should be used instead.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="get-element-count">
                                                            <h3><a href="#get-element-count">Get Element Count</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Returns the number of elements matching ``locator``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Returns the number of elements matching <code>locator</code>.</p>
                                                                <p>If you wish to assert the number of matching elements, use <a href="#page-should-contain-element" class="name">Page Should Contain Element</a> with <code>limit</code> argument. Keyword will always return an integer.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>${count} =</td>
                                                                            <td><a href="#get-element-count" class="name">Get Element Count</a></td>
                                                                            <td>name:div_name</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Should Be True</td>
                                                                            <td>${count} &gt; 2</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>New in SeleniumLibrary 3.0.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="get-element-size">
                                                            <h3><a href="#get-element-size">Get Element Size</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Returns width and height of the element identified by ``locator``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Returns width and height of the element identified by <code>locator</code>.</p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating elements</a> section for details about the locator syntax.</p>
                                                                <p>Both width and height are returned as integers.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>${width}</td>
                                                                            <td>${height} =</td>
                                                                            <td><a href="#get-element-size" class="name">Get Element Size</a></td>
                                                                            <td>css:div#container</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="get-element-status">
                                                            <h3><a href="#get-element-status">Get Element Status</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Return dictionary containing element status of:</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <ul>
                                                                    <li>visible</li>
                                                                    <li>enabled</li>
                                                                    <li>disabled</li>
                                                                    <li>focused</li>
                                                                </ul>
                                                                <p><code>locator</code> element locator</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>&amp;{res}</td>
