                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Returns contents of a table cell.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, None, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>row</td>
                                                                            <td>int</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>column</td>
                                                                            <td>int</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>loglevel</td>
                                                                            <td>str</td>
                                                                            <td>TRACE</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>The table is located using the <code>locator</code> argument and its cell found using <code>row</code> and <code>column</code>. See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating
                                                                        elements</a> section for details about the locator syntax.</p>
                                                                <p>Both row and column indexes start from 1, and header and footer rows are included in the count. It is possible to refer to rows and columns from the end by using negative indexes so that -1 is the last row/column, -2 is the second last, and
                                                                    so on.</p>
                                                                <p>All <code>&lt;th&gt;</code> and <code>&lt;td&gt;</code> elements anywhere in the table are considered to be cells.</p>
                                                                <p>See <a href="#page-should-contain" class="name">Page Should Contain</a> for an explanation about the
                                                                    <code>loglevel</code> argument.
                                                                </p>
                                                            </div>
