                                                        <div class="keyword" id="get-window-position">
                                                            <h3><a href="#get-window-position">Get Window Position</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Returns current window position.</p>


                                                                <p>The position is relative to the top left corner of the screen. Returned values are integers. See also <a href="#set-window-position" class="name">Set Window Position</a>.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
