                                                                            <td>${y}=</td>
                                                                            <td><a href="#get-window-position" class="name">Get Window Position</a></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="get-window-size">
                                                            <h3><a href="#get-window-size">Get Window Size</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Returns current window width and height as integers.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>inner</td>
                                                                            <td>bool</td>
                                                                            <td>False</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>See also <a href="#set-window-size" class="name">Set Window Size</a>.</p>
                                                                <p>If <code>inner</code> parameter is set to True, keyword returns HTML DOM window.innerWidth and window.innerHeight properties. See Boolean arguments for more details on how to set boolean arguments. The <code>inner</code> is new in SeleniumLibrary
                                                                    4.0.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>${width}</td>
