                                                        <div class="keyword" id="handle-alert">
                                                            <h3><a href="#handle-alert">Handle Alert</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Handles the current alert and returns its message.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>action</td>
                                                                            <td>str</td>
                                                                            <td>ACCEPT</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>timeout</td>
                                                                            <td>timedelta</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>By default, the alert is accepted, but this can be controlled with the <code>action</code> argument that supports the following case-insensitive values:</p>
                                                                <ul>
                                                                    <li><code>ACCEPT</code>: Accept the alert i.e. press <code>Ok</code>. Default.</li>
                                                                    <li><code>DISMISS</code>: Dismiss the alert i.e. press <code>Cancel</code>.</li>
                                                                    <li><code>LEAVE</code>: Leave the alert open.</li>
                                                                </ul>
                                                                <p>The <code>timeout</code> argument specifies how long to wait for the alert to appear. If it is not given, the global default <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Timeout" class="name">timeout</a> is used instead.</p>
                                                                <p>Examples:</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>Handle Alert</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td># Accept alert.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Handle Alert</td>
                                                                            <td>action=DISMISS</td>
                                                                            <td></td>
                                                                            <td># Dismiss alert.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Handle Alert</td>
                                                                            <td>timeout=10 s</td>
                                                                            <td></td>
                                                                            <td># Use custom timeout and accept alert.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Handle Alert</td>
                                                                            <td>DISMISS</td>
                                                                            <td>1 min</td>
                                                                            <td># Use custom timeout and dismiss alert.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${message} =</td>
                                                                            <td>Handle Alert</td>
                                                                            <td></td>
                                                                            <td># Accept alert and get its message.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${message} =</td>
                                                                            <td>Handle Alert</td>
                                                                            <td>LEAVE</td>
                                                                            <td># Leave alert open and get its message.</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>New in SeleniumLibrary 3.0.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="highlight-elements">
                                                            <h3><a href="#highlight-elements">Highlight Elements</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Highlight all matching elements by locator.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>width</td>
                                                                            <td>str</td>
                                                                            <td>2px</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>style</td>
                                                                            <td>str</td>
                                                                            <td>dotted</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>color</td>
                                                                            <td>str</td>
                                                                            <td>blue</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>Highlighting is done by adding a colored outline around the elements with CSS styling.</p>
                                                                <p><code>locator</code> element locator <code>width</code> highlight outline width <code>style</code> highlight outline style <code>color</code> highlight outline color</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>Highlight Elements</td>
                                                                            <td><a href="xpath://h3">xpath://h3</a></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="input-password">
                                                            <h3><a href="#input-password">Input Password</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Types the given password into the text field identified by ``locator``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>password</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>clear</td>
                                                                            <td>bool</td>
                                                                            <td>True</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Types the given password into the text field identified by <code>locator</code>.</p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating elements</a> section for details about the locator syntax. See <a href="#input-text" class="name">Input Text</a> for <code>clear</code> argument details.</p>
                                                                <p>Difference compared to <a href="#input-text" class="name">Input Text</a> is that this keyword does not log the given password on the INFO level. Notice that if you use the keyword like</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>Input Password</td>
                                                                            <td>password_field</td>
                                                                            <td>password</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>the password is shown as a normal keyword argument. A way to avoid that is using variables like</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>Input Password</td>
                                                                            <td>password_field</td>
                                                                            <td>${PASSWORD}</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Please notice that Autosphere logs all arguments using the TRACE level and tests must not be executed using level below DEBUG if the password should not be logged in any format.</p>
                                                                <p>The clear argument is new in SeleniumLibrary 4.0. Hiding password logging from Selenium logs is new in SeleniumLibrary 4.2.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="input-text">
                                                            <h3><a href="#input-text">Input Text</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Types the given ``text`` into the text field identified by ``locator``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>text</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>clear</td>
                                                                            <td>bool</td>
                                                                            <td>True</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Types the given <code>text</code> into the text field identified by <code>locator</code>.</p>
                                                                <p>When <code>clear</code> is true, the input element is cleared before the text is typed into the element. When false, the previous text is not cleared from the element. Use <a href="#input-password" class="name">Input Password</a> if you do
                                                                    not want the given <code>text</code> to be logged.</p>
                                                                <p>If <a href="https://github.com/SeleniumHQ/selenium/wiki/Grid2">Selenium Grid</a> is used and the
                                                                    <code>text</code> argument points to a file in the file system, then this keyword prevents the Selenium to transfer the file to the Selenium Grid hub. Instead, this keyword will send the <code>text</code> string as is to the element. If
                                                                    a file should be transferred to the hub and upload should be performed, please use <a href="#choose-file" class="name">Choose File</a> keyword.
                                                                </p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating elements</a> section for details about the locator syntax. See the Boolean arguments section
                                                                    how Boolean values are handled.</p>
                                                                <p>Disabling the file upload the Selenium Grid node and the clear argument are new in SeleniumLibrary 4.0
                                                                </p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="input-text-into-alert">
                                                            <h3><a href="#input-text-into-alert">Input Text Into Alert</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Types the given ``text`` into an input field in an alert.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>text</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>action</td>
                                                                            <td>str</td>
                                                                            <td>ACCEPT</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>timeout</td>
                                                                            <td>timedelta</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Types the given <code>text</code> into an input field in an alert.</p>
                                                                <p>The alert is accepted by default, but that behavior can be controlled by using the <code>action</code> argument same way as with <a href="#handle-alert" class="name">Handle Alert</a>.</p>
                                                                <p><code>timeout</code> specifies how long to wait for the alert to appear. If it is not given, the global default <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Timeout" class="name">timeout</a> is used instead.</p>
                                                                <p>New in SeleniumLibrary 3.0.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="input-text-when-element-is-visible">
                                                            <h3><a href="#input-text-when-element-is-visible">Input Text When Element Is Visible</a>

                                                            </h3>

