                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>text</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p><code>locator</code> element locator</p>
                                                                <p><code>text</code> insert text to locator</p>
                                                                <h4>Examples</h4>
