                                                        <div class="keyword" id="is-alert-present">
                                                            <h3><a href="#is-alert-present">Is Alert Present</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Is alert box present, which can be identified with text and action can also be done which by default is ACCEPT.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>text</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>action</td>
                                                                            <td>str</td>
                                                                            <td>ACCEPT</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>Other possible actions are DISMISS and LEAVE.</p>
                                                                <p><code>text</code> check if alert text is matching to this, if None will check if alert is present at all
                                                                </p>
                                                                <p><code>action</code> possible action if alert is present, default ACCEPT</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>${res}</td>
                                                                            <td>Is Alert Present</td>
                                                                            <td>alert message</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

