                                                        <div class="keyword" id="list-selection-should-be">
                                                            <h3><a href="#list-selection-should-be">List Selection Should Be</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Verifies selection list ``locator`` has ``expected`` options selected.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>expected</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Verifies selection list <code>locator</code> has <code>expected</code> options selected.</p>
                                                                <p>It is possible to give expected options both as visible labels and as values. Starting from SeleniumLibrary 3.0, mixing labels and values is not possible. Order of the selected options is not validated.
                                                                </p>
                                                                <p>If no expected options are given, validates that the list has no selections. A more explicit alternative is using <a href="#list-should-have-no-selections" class="name">List Should Have No Selections</a>.</p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating elements</a> section for details about the locator syntax.</p>
                                                                <p>Examples:</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#list-selection-should-be" class="name">List Selection Should Be</a></td>
                                                                            <td>gender</td>
                                                                            <td>Female</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#list-selection-should-be" class="name">List Selection Should Be</a></td>
                                                                            <td>interests</td>
                                                                            <td>Test Automation</td>
                                                                            <td>Python</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

