                                                        <div class="keyword" id="open-available-browser">
                                                            <h3><a href="#open-available-browser">Open Available Browser</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Attempts to open a browser on the user's device from a set of supported browsers. Automatically downloads a corresponding webdriver if none is already installed.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>url</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>use_profile</td>
                                                                            <td>bool</td>
                                                                            <td>False</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>headless</td>
                                                                            <td>Any</td>
                                                                            <td>AUTO</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>maximized</td>
                                                                            <td>bool</td>
                                                                            <td>False</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>browser_selection</td>
                                                                            <td>Any</td>
                                                                            <td>AUTO</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>alias</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>profile_name</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>profile_path</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>preferences</td>
                                                                            <td>dict</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>proxy</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>user_agent</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>download</td>
                                                                            <td>Any</td>
                                                                            <td>AUTO</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>Optionally can be given a <code>url</code> as the first argument, to open the browser directly to the given page.</p>
                                                                <p>Returns either a generated index or a custom <code>alias</code> for the browser instance. The returned value can be used to refer to that specific browser instance in other keywords.</p>
                                                                <p>If the browser should start in a maximized window, this can be enabled with the argument
                                                                    <code>maximized</code>, but is disabled by default.
                                                                </p>
                                                                <p>For certain applications it might also be required to force a certain user-agent string for Selenium, which can be overriden with the <code>user_agent</code> argument.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>Open Available Browser</td>
                                                                            <td><a href="https://autosphere.ai">https://autosphere.ai</a></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${index}=</td>
                                                                            <td>Open Available Browser</td>
                                                                            <td>${URL}</td>
                                                                            <td>browser_selection=opera,firefox</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Open Available Browser</td>
                                                                            <td>${URL}</td>
                                                                            <td>headless=True</td>
                                                                            <td>alias=HeadlessBrowser</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <h4>Browser order</h4>
                                                                <p>The default order of supported browsers is based on the operating system and is as follows:</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>Platform</td>
                                                                            <td>Default order</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><code>Windows</code> |&nbsp;Chrome, Firefox, Edge, IE, Opera</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><code>Linux</code> |&nbsp;Chrome, Firefox, Opera</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><code>Darwin</code> |&nbsp;Chrome, Safari, Firefox, Opera</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>The order can be overriden with a custom list by using the argument <code>browser_selection</code>. The argument can be either a comma-separated string or a list object.</p>
                                                                <h4>Webdriver download</h4>
                                                                <p>The library can (if requested) automatically download webdrivers for all supported browsers. This can be controlled with the argument <code>download</code>.</p>
                                                                <p>If the value is <code>False</code>, it will only attempt to start webdrivers found from the system PATH.
                                                                </p>
                                                                <p>If the value is <code>True</code>, it will download a webdriver that matches the current browser.</p>
                                                                <p>By default the argument has the value <code>AUTO</code>, which means it first attempts to use webdrivers found in PATH and if that fails forces a webdriver download.</p>
                                                                <h4>Opening process</h4>
                                                                <p>1. Parse list of preferred browser order. If not given, use values from above table.</p>
                                                                <p>2. Loop through listed browsers:</p>
                                                                <p>a. Set the webdriver options for the browser.</p>
                                                                <p>b. Download webdriver (if requested).</p>
                                                                <p>c. Attempt to launch the webdriver and stop the loop if successful.</p>
                                                                <p>3. Return index/alias if webdriver was created, or raise an exception if no browsers were successfully opened.
                                                                </p>
                                                                <h4>Headless mode</h4>
                                                                <p>If required, the browser can also run headless, which means that it does not create a visible window. Generally a headless browser is slightly faster, but might not support all features a normal browser does.
                                                                </p>
                                                                <p>One typical use-case for headless mode is in cloud containers, where there is no display available. It also prevents manual interaction with the browser, which can be either a benefit or a drawback depending on the context.</p>
                                                                <p>It can be explicitly enabled or disabled with the argument <code>headless</code>. By default it will be disabled, unless it detects that it is running in a Linux environment without a display, i.e. a container.
                                                                </p>
                                                                <h4>Chrome options</h4>
                                                                <p>Some features are currently available only for Chrome/Chromium. This includes using an existing user profile. By default Selenium uses a new profile for each session, but it can use an existing one by enabling the <code>use_profile</code> argument.</p>
                                                                <p>If a custom profile is stored somewhere outside of the default location, the path to the profiles directory and the name of the profile can be controlled with <code>profile_path</code> and
                                                                    <code>profile_name</code> respectively.
                                                                </p>
                                                                <p>Profile preferences can be further overriden with the <code>preferences</code> argument by giving a dictionary of key/value pairs.</p>
                                                                <p>Chrome can additionally connect through a <code>proxy</code>, which should be given as either local or remote address.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="open-browser">
                                                            <h3><a href="#open-browser">Open Browser</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Opens a new browser instance to the optional ``url``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>url</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>browser</td>
                                                                            <td>str</td>
                                                                            <td>firefox</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>alias</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>remote_url</td>
                                                                            <td>bool, str</td>
                                                                            <td>False</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>desired_capabilities</td>
                                                                            <td>dict, None, str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>ff_profile_dir</td>
                                                                            <td>FirefoxProfile, str, None</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>options</td>
                                                                            <td>Any</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>service_log_path</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>executable_path</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Opens a new browser instance to the optional <code>url</code>.</p>
                                                                <p>The <code>browser</code> argument specifies which browser to use. The supported browsers are listed in the table below. The browser names are case-insensitive and some browsers have multiple supported names.
                                                                </p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Browser</th>
                                                                            <th>Name(s)</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Firefox</td>
                                                                            <td>firefox, ff</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Google Chrome</td>
                                                                            <td>googlechrome, chrome, gc</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Headless Firefox</td>
                                                                            <td>headlessfirefox</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Headless Chrome</td>
                                                                            <td>headlesschrome</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Internet Explorer</td>
                                                                            <td>internetexplorer, ie</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Edge</td>
                                                                            <td>edge</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Safari</td>
                                                                            <td>safari</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Opera</td>
                                                                            <td>opera</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Android</td>
                                                                            <td>android</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Iphone</td>
                                                                            <td>iphone</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>PhantomJS</td>
                                                                            <td>phantomjs</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>HTMLUnit</td>
                                                                            <td>htmlunit</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>HTMLUnit with Javascript</td>
                                                                            <td>htmlunitwithjs</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>To be able to actually use one of these browsers, you need to have a matching Selenium browser driver available. Headless Firefox and Headless Chrome are new additions in SeleniumLibrary 3.1.0 and require Selenium 3.8.0 or newer.</p>
                                                                <p>After opening the browser, it is possible to use optional <code>url</code> to navigate the browser to the desired address.</p>
                                                                <p>Optional <code>alias</code> is an alias given for this browser instance and it can be used for switching between browsers. When same <code>alias</code> is given with two <a href="#open-browser" class="name">Open Browser</a> keywords, the first
                                                                    keyword will open a new browser, but the second one will switch to the already opened browser and will not open a new browser. The <code>alias</code> definition overrules <code>browser</code> definition. When same <code>alias</code> is
                                                                    used but a different <code>browser</code> is defined, then switch to a browser with same alias is done and new browser is not opened. An alternative approach for switching is using an index returned by this keyword. These indices start
                                                                    from 1, are incremented when new browsers are opened, and reset back to 1 when <a href="#close-all-browsers" class="name">Close All Browsers</a> is called. See <a href="#switch-browser" class="name">Switch Browser</a> for more information
                                                                    and examples.</p>
                                                                <p>Optional <code>remote_url</code> is the URL for a <a href="https://github.com/SeleniumHQ/selenium/wiki/Grid2">Selenium Grid</a>.</p>
                                                                <p>Optional <code>desired_capabilities</code> can be used to configure, for example, logging preferences for a browser or a browser and operating system when using <a href="http://saucelabs.com">Sauce Labs</a>. Desired capabilities can be given
                                                                    either as a Python dictionary or as a string in the format
                                                                    <code>key1:value1,key2:value2</code>. <a href="https://github.com/SeleniumHQ/selenium/wiki/DesiredCapabilities">Selenium documentation</a> lists possible capabilities that can be enabled.
                                                                </p>
                                                                <p>Optional <code>ff_profile_dir</code> is the path to the Firefox profile directory if you wish to overwrite the default profile Selenium uses. Notice that prior to SeleniumLibrary 3.0, the library contained its own profile that was used by
                                                                    default. The <code>ff_profile_dir</code> can also be an instance of the <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver_firefox/selenium.webdriver.firefox.firefox_profile.html">selenium.webdriver.FirefoxProfile</a> . As a third option, it is possible to use FirefoxProfile methods and attributes to define the profile using methods and attributes in the same way as with <code>options</code> argument. Example: It is possible to use FirefoxProfile set_preference
                                                                    to define different profile settings. See
                                                                    <code>options</code> argument documentation in below how to handle backslash escaping.
                                                                </p>
                                                                <p>Optional <code>options</code> argument allows defining browser specific Selenium options. Example for Chrome, the <code>options</code> argument allows defining the following <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver_chrome/selenium.webdriver.chrome.options.html#selenium.webdriver.chrome.options.Options">methods
                                                                        and attributes</a> and for Firefox these <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver_firefox/selenium.webdriver.firefox.options.html?highlight=firefox#selenium.webdriver.firefox.options.Options">methods
                                                                        and attributes</a> are available. Please note that not all browsers, supported by the SeleniumLibrary, have Selenium options available. Therefore please consult the Selenium documentation which browsers do support the Selenium options.
                                                                    If <code>browser</code> argument is android then <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver_chrome/selenium.webdriver.chrome.options.html#selenium.webdriver.chrome.options.Options">Chrome
                                                                        options</a> is used. Selenium options are also supported, when <code>remote_url</code> argument is used.
                                                                </p>
                                                                <p>The SeleniumLibrary <code>options</code> argument accepts Selenium options in two different formats: as a string and as Python object which is an instance of the Selenium options class.</p>
                                                                <p>The string format allows defining Selenium options methods or attributes and their arguments in Autosphere test data. The method and attributes names are case and space sensitive and must match to the Selenium options methods and attributes
                                                                    names. When defining a method, it must be defined in a similar way as in python: method name, opening parenthesis, zero to many arguments and closing parenthesis. If there is a need to define multiple arguments for a single method, arguments
                                                                    must be separated with comma, just like in Python. Example: add_argument("--headless") or add_experimental_option("key", "value"). Attributes are defined in a similar way as in Python: attribute name, equal sign, and attribute value. Example,
                                                                    headless=True. Multiple methods and attributes must be separated by a semicolon. Example: add_argument("--headless");add_argument("--start-maximized").</p>
                                                                <p>Arguments allow defining Python data types and arguments are evaluated by using Python <a href="https://docs.python.org/3/library/ast.html#ast.literal_eval">ast.literal_eval</a>. Strings must be quoted with single or double quotes, example
                                                                    "value" or 'value'. It is also possible to define other Python builtin data types, example True or None, by not using quotes around the arguments.</p>
                                                                <p>The string format is space friendly. Usually, spaces do not alter the defining methods or attributes. There are two exceptions. In some Autosphere test data formats, two or more spaces are considered as cell separator and instead of defining
                                                                    a single argument, two or more arguments may be defined. Spaces in string arguments are not removed and are left as is. Example add_argument ( "--headless" ) is same as add_argument("--headless"). But add_argument(" --headless ") is not
                                                                    same same as add_argument ( "--headless" ), because spaces inside of quotes are not removed. Please note that if options string contains backslash, example a Windows OS path, the backslash needs escaping both in Autosphere data and in
                                                                    Python side. This means single backslash must be writen using four backslash characters. Example, Windows path: "C:\path\to\profile" must be written as "C:\\\\path\\\to\\\\profile". Another way to write backslash is use Python <a href="https://docs.python.org/3/reference/lexical_analysis.html#string-and-bytes-literals">raw
                                                                        strings</a> and example write: r"C:\\path\\to\\profile".</p>
                                                                <p>As last format, <code>options</code> argument also supports receiving the Selenium options as Python class instance. In this case, the instance is used as-is and the SeleniumLibrary will not convert the instance to other formats. For example,
                                                                    if the following code return value is saved to ${options} variable in the Autosphere data:</p>
                                                                <pre>options = webdriver.ChromeOptions()
  options.add_argument('--disable-dev-shm-usage')
  return options
  </pre>
                                                                <p>Then the ${options} variable can be used as an argument to <code>options</code>.</p>
                                                                <p>Example the <code>options</code> argument can be used to launch Chomium-based applications which utilize the <a href="https://bitbucket.org/chromiumembedded/cef/wiki/UsingChromeDriver">Chromium Embedded
                                                                        Framework</a> . To lauch Chomium-based application, use <code>options</code> to define binary_location attribute and use add_argument method to define remote-debugging-port port for the application. Once the browser is opened, the
                                                                    test can interact with the embedded web-content of the system under test.</p>
                                                                <p>Optional <code>service_log_path</code> argument defines the name of the file where to write the browser driver logs. If the <code>service_log_path</code> argument contain a marker <code>{index}</code>, it will be automatically replaced with
                                                                    unique running index preventing files to be overwritten. Indices start's from 1, and how they are represented can be customized using Python's <a href="https://docs.python.org/3/library/string.html#format-string-syntax">format string syntax</a>.
                                                                </p>
                                                                <p>Optional <code>executable_path</code> argument defines the path to the driver executable, example to a chromedriver or a geckodriver. If not defined it is assumed the executable is in the <a href="https://en.wikipedia.org/wiki/PATH_(variable)">$PATH</a>.</p>
                                                                <p>Examples:</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Chrome</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Firefox</td>
                                                                            <td>alias=Firefox</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Edge</td>
                                                                            <td>remote_url=http://127.0.0.1:4444/wd/hub</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td>about:blank</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td>browser=Chrome</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Alias examples:</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>${1_index} =</td>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Chrome</td>
                                                                            <td>alias=Chrome</td>
                                                                            <td># Opens new browser because alias is new.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${2_index} =</td>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Firefox</td>
                                                                            <td></td>
                                                                            <td># Opens new browser because alias is not defined.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${3_index} =</td>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Chrome</td>
                                                                            <td>alias=Chrome</td>
                                                                            <td># Switches to the browser with Chrome alias.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${4_index} =</td>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Chrome</td>
                                                                            <td>alias=${1_index}</td>
                                                                            <td># Switches to the browser with Chrome alias.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Should Be Equal</td>
                                                                            <td>${1_index}</td>
                                                                            <td>${3_index}</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Should Be Equal</td>
                                                                            <td>${1_index}</td>
                                                                            <td>${4_index}</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Should Be Equal</td>
                                                                            <td>${2_index}</td>
                                                                            <td>${2}</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Example when using <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver_chrome/selenium.webdriver.chrome.options.html#selenium.webdriver.chrome.options.Options">Chrome
                                                                        options</a> method:</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Chrome</td>
                                                                            <td>options=add_argument("--disable-popup-blocking"); add_argument("--ignore-certificate-errors")
                                                                            </td>
                                                                            <td># Sting format.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${options} =</td>
                                                                            <td>Get Options</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td># Selenium options instance.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Chrome</td>
                                                                            <td>options=${options}</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td>None</td>
                                                                            <td>Chrome</td>
                                                                            <td>options=binary_location="/path/to/binary";add_argument("remote-debugging-port=port")</td>
                                                                            <td># Start Chomium-based application.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td>None</td>
                                                                            <td>Chrome</td>
                                                                            <td>options=binary_location=r"C:\\path\\to\\binary"</td>
                                                                            <td># Windows OS path escaping.</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Example for FirefoxProfile</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Firefox</td>
                                                                            <td>ff_profile_dir=/path/to/profile</td>
                                                                            <td># Using profile from disk.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Firefox</td>
                                                                            <td>ff_profile_dir=${FirefoxProfile_instance}</td>
                                                                            <td># Using instance of FirefoxProfile.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://example.com">http://example.com</a></td>
                                                                            <td>Firefox</td>
                                                                            <td>ff_profile_dir=set_preference("key", "value");set_preference("other", "setting")</td>
                                                                            <td># Defining profile using FirefoxProfile mehtods.</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>If the provided configuration options are not enough, it is possible to use <a href="#create-webdriver" class="name">Create Webdriver</a> to customize browser initialization even more.</p>
                                                                <p>Applying <code>desired_capabilities</code> argument also for local browser is new in SeleniumLibrary 3.1.
                                                                </p>
                                                                <p>Using <code>alias</code> to decide, is the new browser opened is new in SeleniumLibrary 4.0. The
                                                                    <code>options</code> and <code>service_log_path</code> are new in SeleniumLibrary 4.0. Support for
                                                                    <code>ff_profile_dir</code> accepting an instance of the selenium.webdriver.FirefoxProfile and support defining FirefoxProfile with methods and attributes are new in SeleniumLibrary 4.0.
                                                                </p>
                                                                <p>Making <code>url</code> optional is new in SeleniumLibrary 4.1.</p>
                                                                <p>The <code>executable_path</code> argument is new in SeleniumLibrary 4.2.</p>
                                                            </div>
                                                        </div>

