                                                        <div class="keyword" id="page-should-contain">
                                                            <h3><a href="#page-should-contain">Page Should Contain</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Verifies that current page contains ``text``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>text</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>loglevel</td>
                                                                            <td>str</td>
                                                                            <td>TRACE</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Verifies that current page contains <code>text</code>.</p>
                                                                <p>If this keyword fails, it automatically logs the page source using the log level specified with the optional <code>loglevel</code> argument. Valid log levels are <code>DEBUG</code>, <code>INFO</code> (default), <code>WARN</code>, and <code>NONE</code>.
                                                                    If the log level is <code>NONE</code> or below the current active log level the source will not be logged.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="page-should-contain-button">
                                                            <h3><a href="#page-should-contain-button">Page Should Contain Button</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Verifies button ``locator`` is found from current page.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
