                                                        <div class="keyword" id="press-keys">
                                                            <h3><a href="#press-keys">Press Keys</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Simulates the user pressing key(s) to an element or on the active browser.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, None, str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>keys</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>If <code>locator</code> evaluates as false, see Boolean arguments for more details, then the
                                                                    <code>keys</code> are sent to the currently active browser. Otherwise element is searched and
                                                                    <code>keys</code> are send to the element identified by the <code>locator</code>. In later case, keyword fails if element is not found. See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating
                                                                        elements</a> section for details about the locator syntax.
                                                                </p>
                                                                <p><code>keys</code> arguments can contain one or many strings, but it can not be empty. <code>keys</code> can also be a combination of <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver/selenium.webdriver.common.keys.html">Selenium
                                                                        Keys</a> and strings or a single Selenium Key. If Selenium Key is combined with strings, Selenium key and strings must be separated by the + character, like in CONTROL+c. Selenium Keys are space and case sensitive and Selenium Keys
                                                                    are not parsed inside of the string. Example AALTO, would send string AALTO and ALT not parsed inside of the string. But A+ALT+O would found Selenium ALT key from the
                                                                    <code>keys</code> argument. It also possible to press many Selenium Keys down at the same time, example 'ALT+ARROW_DOWN`.
                                                                </p>
                                                                <p>If Selenium Keys are detected in the <code>keys</code> argument, keyword will press the Selenium Key down, send the strings and then release the Selenium Key. If keyword needs to send a Selenium Key as a string, then each character must be
                                                                    separated with + character, example E+N+D.</p>
                                                                <p>CTRL is alias for <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver/selenium.webdriver.common.keys.html#selenium.webdriver.common.keys.Keys.CONTROL">Selenium
                                                                        CONTROL</a> and ESC is alias for <a href="https://seleniumhq.github.io/selenium/docs/api/py/webdriver/selenium.webdriver.common.keys.html#selenium.webdriver.common.keys.Keys.ESCAPE">Selenium
                                                                        ESCAPE</a></p>
                                                                <p>New in SeleniumLibrary 3.3</p>
                                                                <p>Examples:</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#press-keys" class="name">Press Keys</a></td>
                                                                            <td>text_field</td>
                                                                            <td>AAAAA</td>
                                                                            <td></td>
                                                                            <td># Sends string "AAAAA" to element.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#press-keys" class="name">Press Keys</a></td>
                                                                            <td>None</td>
                                                                            <td>BBBBB</td>
                                                                            <td></td>
                                                                            <td># Sends string "BBBBB" to currently active browser.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#press-keys" class="name">Press Keys</a></td>
                                                                            <td>text_field</td>
                                                                            <td>E+N+D</td>
                                                                            <td></td>
                                                                            <td># Sends string "END" to element.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#press-keys" class="name">Press Keys</a></td>
                                                                            <td>text_field</td>
                                                                            <td>XXX</td>
                                                                            <td>YY</td>
                                                                            <td># Sends strings "XXX" and "YY" to element.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#press-keys" class="name">Press Keys</a></td>
                                                                            <td>text_field</td>
                                                                            <td>XXX+YY</td>
                                                                            <td></td>
                                                                            <td># Same as above.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#press-keys" class="name">Press Keys</a></td>
                                                                            <td>text_field</td>
                                                                            <td>ALT+ARROW_DOWN</td>
                                                                            <td></td>
                                                                            <td># Pressing "ALT" key down, then pressing ARROW_DOWN and then releasing both keys.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#press-keys" class="name">Press Keys</a></td>
                                                                            <td>text_field</td>
                                                                            <td>ALT</td>
                                                                            <td>ARROW_DOWN</td>
                                                                            <td># Pressing "ALT" key and then pressing ARROW_DOWN.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#press-keys" class="name">Press Keys</a></td>
                                                                            <td>text_field</td>
                                                                            <td>CTRL+c</td>
                                                                            <td></td>
                                                                            <td># Pressing CTRL key down, sends string "c" and then releases CTRL key.</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#press-keys" class="name">Press Keys</a></td>
                                                                            <td>button</td>
                                                                            <td>RETURN</td>
                                                                            <td></td>
                                                                            <td># Pressing "ENTER" key to element.</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

