                                                        <div class="keyword" id="register-keyword-to-run-on-failure">
                                                            <h3><a href="#register-keyword-to-run-on-failure">Register Keyword To Run On Failure</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Sets the keyword to execute, when a SeleniumLibrary keyword fails.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>keyword</td>
                                                                            <td>str, None</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p><code>keyword</code> is the name of a keyword that will be executed if a SeleniumLibrary keyword fails. It is possible to use any available keyword, including user keywords or keywords from other libraries, but the keyword must not take any
                                                                    arguments.</p>
                                                                <p>The initial keyword to use is set when <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Importing" class="name">importing</a> the library, and the keyword that is used by default is
                                                                    <a href="#capture-page-screenshot" class="name">Capture Page Screenshot</a>. Taking a screenshot when something failed is a very useful feature, but notice that it can slow down the execution.
                                                                </p>
                                                                <p>It is possible to use string <code>NOTHING</code> or <code>NONE</code>, case-insensitively, as well as Python <code>None</code> to disable this feature altogether.</p>
                                                                <p>This keyword returns the name of the previously registered failure keyword or Python <code>None</code> if this functionality was previously disabled. The return value can be always used to restore the original value later.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#register-keyword-to-run-on-failure" class="name">Register Keyword To Run On
                                                                                    Failure</a></td>
                                                                            <td>Log Source</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${previous kw}=</td>
                                                                            <td><a href="#register-keyword-to-run-on-failure" class="name">Register Keyword To Run On
                                                                                    Failure</a></td>
                                                                            <td>NONE</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#register-keyword-to-run-on-failure" class="name">Register Keyword To Run On
                                                                                    Failure</a></td>
                                                                            <td>${previous kw}</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Changes in SeleniumLibrary 3.0:</p>
                                                                <ul>
                                                                    <li>Possible to use string <code>NONE</code> or Python <code>None</code> to disable the functionality.
                                                                    </li>
                                                                    <li>Return Python <code>None</code> when the functionality was disabled earlier. In previous versions special value <code>No Keyword</code> was returned and it could not be used to restore the original state.
                                                                    </li>
                                                                </ul>
                                                            </div>
                                                        </div>

