                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>filename</td>
                                                                            <td>str</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p><code>locator</code> if defined, take element screenshot, if not takes page screenshot</p>
                                                                <p><code>filename</code> filename for the screenshot, by default creates file screenshot-timestamp-element/page.png if set to None then file is not saved at all</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>Screenshot</td>
                                                                            <td>locator=//img[@alt="Google"]</td>
                                                                            <td>filename=locator.png</td>
                                                                            <td># element screenshot, defined filename</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Screenshot</td>
                                                                            <td>filename=page.png</td>
                                                                            <td></td>
                                                                            <td># page screenshot, defined filename</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Screenshot</td>
                                                                            <td>filename=${NONE}</td>
                                                                            <td></td>
                                                                            <td># page screenshot, NO file will be created</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Screenshot</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td># page screenshot, default filename</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Screenshot</td>
                                                                            <td>locator=//img[@alt="Google"]</td>
                                                                            <td></td>
                                                                            <td># element screenshot, default filename</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Screenshot</td>
                                                                            <td>locator=//img[@alt="Google"]</td>
                                                                            <td>filename=${CURDIR}/subdir/loc.png</td>
                                                                            <td># element screenshot, create dirs if not existing</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

