                                                        <div class="keyword" id="set-screenshot-directory">
                                                            <h3><a href="#set-screenshot-directory">Set Screenshot Directory</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Sets the directory for captured screenshots.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>path</td>
                                                                            <td>None, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p><code>path</code> argument specifies the absolute path to a directory where the screenshots should be written to. If the directory does not exist, it will be created. The directory can also be set when <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Importing" class="name">importing</a> the library. If it is not configured anywhere, screenshots are saved to the same directory where Autosphere's log file is written.</p>
                                                                <p>If <code>path</code> equals to EMBED (case insensitive) and <a href="#capture-page-screenshot" class="name">Capture Page Screenshot</a> or <a href="#capture-element-screenshot" class="name">capture Element Screenshot</a> keywords filename
                                                                    argument is not changed from the default value, then the page or element screenshot is embedded as Base64 image to the log.html.</p>
                                                                <p>The previous value is returned and can be used to restore the original value later if needed.</p>
                                                                <p>Returning the previous value is new in SeleniumLibrary 3.0. The persist argument was removed in SeleniumLibrary 3.2 and EMBED is new in SeleniumLibrary 4.2.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="set-selenium-implicit-wait">
                                                            <h3><a href="#set-selenium-implicit-wait">Set Selenium Implicit Wait</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Sets the implicit wait value used by Selenium.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>value</td>
                                                                            <td>timedelta</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>The value can be given as a number that is considered to be seconds or as a human-readable string like
                                                                    <code>1 second</code>. The previous value is returned and can be used to restore the original value later if needed.
                                                                </p>
                                                                <p>This keyword sets the implicit wait for all opened browsers. Use <a href="#set-browser-implicit-wait" class="name">Set Browser Implicit Wait</a> to set it only to the current browser.</p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Implicit-wait" class="name">Implicit wait</a> section above for more information.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>${orig wait} =</td>
                                                                            <td><a href="#set-selenium-implicit-wait" class="name">Set Selenium Implicit Wait</a></td>
                                                                            <td>10 seconds</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Perform AJAX call that is slow</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#set-selenium-implicit-wait" class="name">Set Selenium Implicit Wait</a></td>
                                                                            <td>${orig wait}</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

