                                                                        <tr>
                                                                            <td><a href="#set-selenium-speed" class="name">Set Selenium Speed</a></td>
                                                                            <td>0.5 seconds</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="set-selenium-timeout">
                                                            <h3><a href="#set-selenium-timeout">Set Selenium Timeout</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Sets the timeout that is used by various keywords.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>value</td>
                                                                            <td>timedelta</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>

                                                                <p>The value can be given as a number that is considered to be seconds or as a human-readable string like
                                                                    <code>1 second</code>. The previous value is returned and can be used to restore the original value later if needed.
                                                                </p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Timeout" class="name">Timeout</a> section above for more information.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>${orig timeout} =</td>
                                                                            <td><a href="#set-selenium-timeout" class="name">Set Selenium Timeout</a></td>
                                                                            <td>15 seconds</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>Open page that loads slowly</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#set-selenium-timeout" class="name">Set Selenium Timeout</a></td>
                                                                            <td>${orig timeout}</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="set-window-position">
                                                            <h3><a href="#set-window-position">Set Window Position</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Sets window position using ``x`` and ``y`` coordinates.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>x</td>
                                                                            <td>int</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>y</td>
                                                                            <td>int</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Sets window position using <code>x</code> and <code>y</code> coordinates.</p>
                                                                <p>The position is relative to the top left corner of the screen, but some browsers exclude possible task bar set by the operating system from the calculation. The actual position may thus be different with different browsers.</p>
                                                                <p>Values can be given using strings containing numbers or by using actual numbers. See also <a href="#get-window-position" class="name">Get Window Position</a>.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#set-window-position" class="name">Set Window Position</a></td>
                                                                            <td>100</td>
                                                                            <td>200</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="set-window-size">
                                                            <h3><a href="#set-window-size">Set Window Size</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Sets current windows size to given ``width`` and ``height``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>width</td>
                                                                            <td>int</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>height</td>
                                                                            <td>int</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>inner</td>
                                                                            <td>bool</td>
                                                                            <td>False</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Sets current windows size to given <code>width</code> and <code>height</code>.</p>
                                                                <p>Values can be given using strings containing numbers or by using actual numbers. See also <a href="#get-window-size" class="name">Get Window Size</a>.</p>
                                                                <p>Browsers have a limit on their minimum size. Trying to set them smaller will cause the actual size to be bigger than the requested size.</p>
                                                                <p>If <code>inner</code> parameter is set to True, keyword sets the necessary window width and height to have the desired HTML DOM <i>window.innerWidth</i> and <i>window.innerHeight</i>. See Boolean arguments for more details on how to set boolean
                                                                    arguments.</p>
                                                                <p>The <code>inner</code> argument is new since SeleniumLibrary 4.0.</p>
                                                                <p>This <code>inner</code> argument does not support Frames. If a frame is selected, switch to default before running this.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#set-window-size" class="name">Set Window Size</a></td>
                                                                            <td>800</td>
                                                                            <td>600</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#set-window-size" class="name">Set Window Size</a></td>
                                                                            <td>800</td>
                                                                            <td>600</td>
                                                                            <td>True</td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="simulate-event">
                                                            <h3><a href="#simulate-event">Simulate Event</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Simulates ``event`` on the element identified by ``locator``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>event</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Simulates <code>event</code> on the element identified by <code>locator</code>.</p>
                                                                <p>This keyword is useful if element has <code>OnEvent</code> handler that needs to be explicitly invoked.
                                                                </p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating elements</a> section for details about the locator syntax.</p>
                                                                <p>Prior to SeleniumLibrary 3.0 this keyword was named Simulate.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="submit-form">
                                                            <h3><a href="#submit-form">Submit Form</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Submits a form identified by ``locator``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, None, str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Submits a form identified by <code>locator</code>.</p>
                                                                <p>If <code>locator</code> is not given, first form on the page is submitted.</p>
                                                                <p>See the <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">Locating elements</a> section for details about the locator syntax.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="switch-browser">
                                                            <h3><a href="#switch-browser">Switch Browser</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Switches between active browsers using ``index_or_alias``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>index_or_alias</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Switches between active browsers using <code>index_or_alias</code>.</p>
                                                                <p>Indices are returned by the <a href="#open-browser" class="name">Open Browser</a> keyword and aliases can be given to it explicitly. Indices start from 1.</p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://google.com">http://google.com</a></td>
                                                                            <td>ff</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#location-should-be" class="name">Location Should Be</a></td>
                                                                            <td><a href="http://google.com">http://google.com</a></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://yahoo.com">http://yahoo.com</a></td>
                                                                            <td>ie</td>
                                                                            <td>alias=second</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#location-should-be" class="name">Location Should Be</a></td>
                                                                            <td><a href="http://yahoo.com">http://yahoo.com</a></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#switch-browser" class="name">Switch Browser</a></td>
                                                                            <td>1</td>
                                                                            <td># index</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#page-should-contain" class="name">Page Should Contain</a></td>
                                                                            <td>I'm feeling lucky</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#switch-browser" class="name">Switch Browser</a></td>
                                                                            <td>second</td>
                                                                            <td># alias</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#page-should-contain" class="name">Page Should Contain</a></td>
                                                                            <td>More Yahoo!</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#close-all-browsers" class="name">Close All Browsers</a></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Above example expects that there was no other open browsers when opening the first one because it used index <code>1</code> when switching to it later. If you are not sure about that, you can store the index into a variable as below.</p>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td>${index} =</td>
                                                                            <td><a href="#open-browser" class="name">Open Browser</a></td>
                                                                            <td><a href="http://google.com">http://google.com</a></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td># Do something ...</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#switch-browser" class="name">Switch Browser</a></td>
                                                                            <td>${index}</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="switch-window">
                                                            <h3><a href="#switch-window">Switch Window</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Switches to browser window matching ``locator``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>list, str</td>
                                                                            <td>MAIN</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>timeout</td>
                                                                            <td>str</td>
                                                                            <td>None</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>browser</td>
                                                                            <td>str</td>
                                                                            <td>CURRENT</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Switches to browser window matching <code>locator</code>.</p>
                                                                <p>If the window is found, all subsequent commands use the selected window, until this keyword is used again. If the window is not found, this keyword fails. The previous windows handle is returned and can be used to switch back to it later.</p>
                                                                <p>Notice that alerts should be handled with <a href="#handle-alert" class="name">Handle Alert</a> or other alert related keywords.</p>
                                                                <p>The <code>locator</code> can be specified using different strategies somewhat similarly as when <a href="documantation.php?page=libraries&node=Autosphere-framework&subnode=Autosphere-browser-Selenium#Locating-elements" class="name">locating
                                                                        elements</a> on pages.</p>
                                                                <ul>
                                                                    <li>By default, the <code>locator</code> is matched against window handle, name, title, and URL. Matching is done in that order and the first matching window is selected.</li>
                                                                </ul>
                                                                <ul>
                                                                    <li>The <code>locator</code> can specify an explicit strategy by using the format
                                                                        <code>strategy:value</code> (recommended) or <code>strategy=value</code>. Supported strategies are
                                                                        <code>name</code>, <code>title</code>, and <code>url</code>. These matches windows using their name, title, or URL, respectively. Additionally, <code>default</code> can be used to explicitly use the default strategy explained above.
                                                                    </li>
                                                                </ul>
                                                                <ul>
                                                                    <li>If the <code>locator</code> is <code>NEW</code> (case-insensitive), the latest opened window is selected. It is an error if this is the same as the current window.</li>
                                                                </ul>
                                                                <ul>
                                                                    <li>If the <code>locator</code> is <code>MAIN</code> (default, case-insensitive), the main window is selected.
                                                                    </li>
                                                                </ul>
                                                                <ul>
                                                                    <li>If the <code>locator</code> is <code>CURRENT</code> (case-insensitive), nothing is done. This effectively just returns the current window handle.</li>
                                                                </ul>
                                                                <ul>
                                                                    <li>If the <code>locator</code> is not a string, it is expected to be a list of window handles <i>to
                                                                            exclude</i>. Such a list of excluded windows can be got from <a href="#get-window-handles" class="name">Get Window Handles</a> before doing an action that opens a new window.</li>
                                                                </ul>
                                                                <p>The <code>timeout</code> is used to specify how long keyword will poll to select the new window. The
                                                                    <code>timeout</code> is new in SeleniumLibrary 3.2.
                                                                </p>
                                                                <h4>Examples</h4>
                                                                <table border="1">
                                                                    <tbody>
                                                                        <tr>
                                                                            <td><a href="#click-link" class="name">Click Link</a></td>
                                                                            <td>popup1</td>
                                                                            <td></td>
                                                                            <td># Open new window</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#switch-window" class="name">Switch Window</a></td>
                                                                            <td>example</td>
                                                                            <td></td>
                                                                            <td># Select window using default strategy</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#title-should-be" class="name">Title Should Be</a></td>
                                                                            <td>Pop-up 1</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#click-button" class="name">Click Button</a></td>
                                                                            <td>popup2</td>
                                                                            <td></td>
                                                                            <td># Open another window</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${handle} =</td>
                                                                            <td><a href="#switch-window" class="name">Switch Window</a></td>
                                                                            <td>NEW</td>
                                                                            <td># Select latest opened window</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#title-should-be" class="name">Title Should Be</a></td>
                                                                            <td>Pop-up 2</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#switch-window" class="name">Switch Window</a></td>
                                                                            <td>${handle}</td>
                                                                            <td></td>
                                                                            <td># Select window using handle</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#title-should-be" class="name">Title Should Be</a></td>
                                                                            <td>Pop-up 1</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#switch-window" class="name">Switch Window</a></td>
                                                                            <td>MAIN</td>
                                                                            <td></td>
                                                                            <td># Select the main window</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#title-should-be" class="name">Title Should Be</a></td>
                                                                            <td>Main</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>${excludes} =</td>
                                                                            <td><a href="#get-window-handles" class="name">Get Window Handles</a></td>
                                                                            <td></td>
                                                                            <td># Get list of current windows</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#click-link" class="name">Click Link</a></td>
                                                                            <td>popup3</td>
                                                                            <td></td>
                                                                            <td># Open one more window</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#switch-window" class="name">Switch Window</a></td>
                                                                            <td>${excludes}</td>
                                                                            <td></td>
                                                                            <td># Select window using excludes</td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td><a href="#title-should-be" class="name">Title Should Be</a></td>
                                                                            <td>Pop-up 3</td>
                                                                            <td></td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>The <code>browser</code> argument allows with <code>index_or_alias</code> to implicitly switch to a specific browser when switching to a window. See <a href="#switch-browser" class="name">Switch
                                                                        Browser</a></p>
                                                                <ul>
                                                                    <li>If the <code>browser</code> is <code>CURRENT</code> (case-insensitive), no other browser is selected.
                                                                    </li>
                                                                </ul>
                                                                <p><b>NOTE:</b></p>
                                                                <ul>
                                                                    <li>The <code>strategy:value</code> syntax is only supported by SeleniumLibrary 3.0 and newer.</li>
                                                                    <li>Prior to SeleniumLibrary 3.0 matching windows by name, title and URL was case-insensitive.</li>
                                                                    <li>Earlier versions supported aliases <code>None</code>, <code>null</code> and the empty string for selecting the main window, and alias <code>self</code> for selecting the current window. Support for these aliases was removed in SeleniumLibrary
                                                                        3.2.</li>
                                                                </ul>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="table-cell-should-contain">
                                                            <h3><a href="#table-cell-should-contain">Table Cell Should Contain</a>

                                                            </h3>

                                                            <div>
                                                                <p class="shortdoc">Verifies table cell contains text ``expected``.</p>
                                                                <h4>Arguments</h4>
                                                                <table class="arguments">
                                                                    <tbody>
                                                                        <tr>
                                                                            <th>Argument</th>
                                                                            <th>Type</th>
                                                                            <th>Default value</th>
                                                                            <th>Description</th>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>locator</td>
                                                                            <td>WebElement, None, str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>row</td>
                                                                            <td>int</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>column</td>
                                                                            <td>int</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>expected</td>
                                                                            <td>str</td>
                                                                            <td>null</td>
                                                                            <td></td>
                                                                        </tr>
                                                                        <tr>
                                                                            <td>loglevel</td>
                                                                            <td>str</td>
                                                                            <td>TRACE</td>
                                                                            <td></td>
                                                                        </tr>
                                                                    </tbody>
                                                                </table>
                                                                <p>Verifies table cell contains text <code>expected</code>.</p>
                                                                <p>See <a href="#get-table-cell" class="name">Get Table Cell</a> that this keyword uses internally for an explanation about accepted arguments.</p>
                                                            </div>
                                                        </div>

                                                        <div class="keyword" id="table-column-should-contain">
                                                            <h3><a href="#table-column-should-contain">Table Column Should Contain</a>

                                                            </h3>

